import React from 'react';

const CualNombre = () => {
	return (
		<div className="main">
			<div className="ui container center">
				<h2>Cual es tu nombre?</h2>
			</div>
			
			<Link to="/cualnombre">
				<button className="ui button blue right">
					Continuar
				</button>
			</Link>
		</div>
	);
};

export default CualNombre;
